import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class BestGenreRow extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div className="movieResults">
				<div className="Peace/Conflict Score">{this.props.genre}</div>
				<div className="Number of Treatises">{this.props.rating}</div>
				<div className="Number of Conflicts">{this.props.rating}</div>
			</div>
		);
	}
}
